import express from "express";
import userController from "../controllers/userController";
import wareHouseController from "../controllers/wareHouseController";


let router = express.Router();

let initWebRoutes = (app) => {

  // API AUTHENTICATE
  router.post("/api/auth/signin", userController.handleLogin);
  router.post("/api/auth/signup", userController.handleRegister);

  // API USER
  router.get("/api/user", userController.handleGetAllUser);
  router.put("/api/user/edit", userController.handleEditUser);
  router.delete("/api/user/delete", userController.handleDeleteUser);



  // API PRODUCT
  router.get("/api/warehouse", wareHouseController.handleGetAllProduct);
  router.post("/api/warehouse/create", wareHouseController.handleCreateProduct);
  router.put("/api/warehouse/edit", wareHouseController.handleEditProduct);
  router.delete("/api/warehouse/delete",wareHouseController.handleDeleteProduct);

 

  return app.use("/", router);
};

module.exports = initWebRoutes;

