import orderService from "../services/orderService";

let handleGetAllOrder = async (req, res) => {
  let id = req.query.id; // ALL, Id

  if (!id) {
    return res.status(200).json({
      errCode: 1,
      errMessage: "Missing required parameter",
      orders: [],
    });
  }

  let orders = await orderService.getAllOrder(id);

  return res.status(200).json({
    errCode: 0,
    errMessage: "OK",
    orders,
  });
};
let handleCreateOrder = async (req, res) => {
  let orderShopping = req.body;
  if (!orderShopping) {
    return res.status(200).json({
      errCode: 1,
      errMessage: "Vui lng in thng tin",
      orders: [],
    });
  }

  let orders = await orderService.createOrder(orderShopping);

  return res.status(200).json({
    errCode: 0,
    errMessage: "OK",
    orders,
  });
};

module.exports = {
  handleGetAllOrder: handleGetAllOrder,
  handleCreateOrder: handleCreateOrder,
};

