import db from "../models/index";

let getAllOrder = (orderId) => {
  return new Promise(async (resolve, reject) => {
    try {
      let orders = "";
      if (orderId === "ALL") {
        orders = await db.OrderLists.findAll({});
      }
      if (orderId && orderId !== "ALL") {
        orders = await db.OrderLists.findOne({
          where: { id: orderId },
        });
      }
      resolve(orders);
    } catch (e) {
      reject(e);
    }
  });
};

let createOrder = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (data) {
        // await db.Order.create({
        //   idOrder: data.idOrder,
        //   cusName: data.cusName,
        //   cusEmail: data.cusEmail,
        //   cusPhone: data.cusPhone,
        //   cusAdress: data.cusAdress,
        //   orderNote: data.orderNote,
        //   cart: data.cart,
        //   idOrder: DataTypes.STRING,
        //   idCus: { type: DataTypes.STRING, required: true, allowNull: false },
        //   idShipping: DataTypes.STRING,
        //   idProduct: DataTypes.STRING,
        //   amout: DataTypes.INTEGER,
        // });
        console.log(data, "data from createOrder");
        console.log(data.cart, "cart from createOrder");

        resolve({
          errCode: 0,
          message: "Post was created successfully!",
        });
      } else {
        resolve({
          errCode: 2,
          message: "Data aren't founded!",
        });
      }
    } catch (error) {
      reject(error);
    }
  });
};

module.exports = {
  getAllOrder: getAllOrder,
  createOrder: createOrder,
};

