sourcesContent:
import wareHouseService from "../services/licenseService";

let handleGetAllProduct = async (req, res) => {
  let id = req.query.id; // ALL, Id

  if (!id) {
    return res.status(200).json({
      errCode: 1,
      errMessage: "Missing required parameter",
      products: [],
    });
  }

  let products = await wareHouseService.getAllProduct(id);

  return res.status(200).json({
    errCode: 0,
    errMessage: "OK",
    products,
  });
};

let handleCreateProduct = async (req, res) => {
  let message = await wareHouseService.createProduct(req.body);
  return res.status(200).json(message);
};

let handleEditProduct = async (req, res) => {
  let data = req.body;
  let message = await wareHouseService.updateProduct(data);
  return res.status(200).json(message);
};

let handleDeleteProduct = async (req, res) => {
  let id = req.body.idItem;

  if (!id) {
    return res.status(200).json({
      errCode: 1,
      errMessage: "Missing required params",
    });
  }

  let message = await wareHouseService.deleteProductById(id);
  return res.status(200).json(message);
};

module.exports = {
  handleGetAllProduct: handleGetAllProduct,
  handleCreateProduct: handleCreateProduct,
  handleEditProduct: handleEditProduct,
  handleDeleteProduct: handleDeleteProduct,
};

