sourcesContent:
import customerService from "../services/customerService";

let handleGetAllCustomer = async (req, res) => {
  let id = req.query.id; // ALL, Id

  if (!id) {
    return res.status(200).json({
      errCode: 1,
      errMessage: "Missing required parameter",
      customers: [],
    });
  }

  let customers = await customerService.getAllCustomer(id);

  return res.status(200).json({
    errCode: 0,
    errMessage: "OK",
    customers,
  });
};

let handleCreateCus = async (req, res) => {
  let message = await customerService.createCus(req.body);
  return res.status(200).json(message);
};

let handleEditCus = async (req, res) => {
  let data = req.body;
  let message = await customerService.updateCus(data);
  return res.status(200).json(message);
};

let handleDeleteCus = async (req, res) => {
  let id = req.body.id;

  if (!id) {
    return res.status(200).json({
      errCode: 1,
      errMessage: "Missing required params",
    });
  }

  let message = await customerService.deleteCusById(id);
  return res.status(200).json(message);
};

module.exports = {
  handleGetAllCustomer: handleGetAllCustomer,
  handleCreateCus: handleCreateCus,
  handleEditCus: handleEditCus,
  handleDeleteCus: handleDeleteCus,
};

