import db from "../models/index";

let checkCustomerEmail = (email) => {
  return new Promise(async (resolve, reject) => {
    try {
      let user = await db.Customers.findOne({
        where: { emailCus: email },
      });
      if (user) {
        resolve(true);
      } else {
        resolve(false);
      }
    } catch (error) {
      reject(error);
    }
  });
};

let getAllCustomer = (customerId) => {
  return new Promise(async (resolve, reject) => {
    try {
      let customers = "";
      if (customerId === "ALL") {
        customers = await db.Customers.findAll({});
      }
      if (customerId && customerId !== "ALL") {
        customers = await db.Customers.findOne({
          where: { id: customerId },
        });
      }
      resolve(customers);
    } catch (e) {
      reject(e);
    }
  });
};

let createCus = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (data) {
        let checkEmail = await checkCustomerEmail(data.emailCus);
        if (!checkEmail) {
          await db.Customers.create({
            fullNameCus: data.fullNameCus,
            emailCus: data.emailCus,
            phoneCus: data.phoneCus,
            genderCus: data.genderCus === "1" ? true : false,
            adressCus: data.adressCus,
          });
          resolve({
            errCode: 0,
            message: "Customer was created successfully!",
          });
        } else {
          resolve({
            errCode: 1,
            message: "Your email existed!",
          });
        }
      } else {
        resolve({
          errCode: 2,
          message: "Data aren't founded!",
        });
      }
    } catch (error) {
      reject(error);
    }
  });
};

let updateCus = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!data.id) {
        resolve({
          errCode: 2,
          errMessage: "Missing required params",
        });
      }

      let user = await db.Customers.findOne({
        where: { id: data.id },
        raw: false,
      });

      if (user) {
        let checkEmail = await checkCustomerEmail(data.emailCus);
        if (!checkEmail) {
          user.fullNameCus = data.fullNameCus;
          user.emailCus = data.emailCus;
          user.phoneCus = data.phoneCus;
          user.genderCus = data.genderCus;
          user.adressCus = data.adressCus;

          await user.save();
          resolve({
            errCode: 0,
            message: " was updated successfully!",
          });
        } else {
          resolve({
            errCode: 1,
            errMessage: `Email existed! Please try another email!`,
          });
        }
      } else {
        resolve({ errCode: 3, errMessage: "User not found!" });
      }
    } catch (error) {
      reject(error);
    }
  });
};

let deleteCusById = (userId) => {
  return new Promise(async (resolve, reject) => {
    try {
      let user = await db.Customers.findOne({
        where: { id: userId },
      });
      if (!user) {
        resolve({
          errCode: 1,
          errMessage: "Customer isn't exist",
        });
      }

      await db.Customers.destroy({
        where: { id: userId },
      });

      resolve({ errCode: 0, message: " was deleted!" });
    } catch (error) {
      reject(error);
    }
  });
};
module.exports = {
  getAllCustomer: getAllCustomer,
  createCus: createCus,
  updateCus: updateCus,
  deleteCusById: deleteCusById,
};

