import postService from "../services/postService";

let handleGetAllPost = async (req, res) => {
  let id = req.query.id; // ALL, Id

  if (!id) {
    return res.status(200).json({
      errCode: 1,
      errMessage: "Missing required parameter",
      posts: [],
    });
  }

  let posts = await postService.getAllPosts(id);

  return res.status(200).json({
    errCode: 0,
    errMessage: "OK",
    posts,
  });
};

let handleCreatePost = async (req, res) => {
  let message = await postService.createPost(req.body);
  return res.status(200).json(message);
};

let handleEditPost = async (req, res) => {
  let data = req.body;
  let message = await postService.updatePost(data);
  return res.status(200).json(message);
};

let handleDeletePost = async (req, res) => {
  let id = req.body.id;

  if (!id) {
    return res.status(200).json({
      errCode: 1,
      errMessage: "Missing required params",
    });
  }

  let message = await postService.deletePostById(id);
  return res.status(200).json(message);
};

module.exports = {
  handleGetAllPost,
  handleCreatePost,
  handleEditPost,
  handleDeletePost,
};

