sourcesContent:
import db from "../models/index";

let getAllPosts = (postId) => {
  return new Promise(async (resolve, reject) => {
    try {
      let posts = "";
      if (postId === "ALL") {
        posts = await db.Posts.findAll({});
      }
      if (postId && postId !== "ALL") {
        posts = await db.Posts.findOne({
          where: { id: postId },
        });
      }
      resolve(posts);
    } catch (e) {
      reject(e);
    }
  });
};

let createPost = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (data) {
        await db.Posts.create({
          author: data.author,
          url: data.url,
          title: data.title,
          body: data.body,
          bodyHtml: data.bodyHtml,
          featureImg: data.featureImg,
          category: data.category,
          keywordTag: data.keywordTag,
          titleTag: data.titleTag,
          descripTag: data.descripTag,
        });
        resolve({
          errCode: 0,
          message: "Post was created successfully!",
        });
      } else {
        resolve({
          errCode: 2,
          message: "Data aren't founded!",
        });
      }
    } catch (error) {
      reject(error);
    }
  });
};

let updatePost = (data) => {
  return new Promise(async (resolve, reject) => {
    try {
      if (!data.id) {
        resolve({
          errCode: 2,
          errMessage: "Missing required params",
        });
      }

      let post = await db.Posts.findOne({
        where: { id: data.id },
        raw: false,
      });

      if (post) {
        post.author = data.author;
        post.url = data.url;
        post.title = data.title;
        post.body = data.body;
        post.bodyHtml = data.bodyHtml;
        post.featureImg = data.featureImg;
        post.category = data.category;
        post.keywordTag = data.keywordTag;
        post.titleTag = data.titleTag;
        post.descripTag = data.descripTag;
        await post.save();
        resolve({
          errCode: 0,
          message: " was updated successfully!",
        });
      } else {
        resolve({ errCode: 3, errMessage: "Post not found!" });
      }
    } catch (error) {
      reject(error);
    }
  });
};

let deletePostById = (postId) => {
  return new Promise(async (resolve, reject) => {
    try {
      let post = await db.Posts.findOne({
        where: { id: postId },
      });
      if (!post) {
        resolve({
          errCode: 1,
          errMessage: "Post isn't exist",
        });
      }

      await db.Posts.destroy({
        where: { id: postId },
      });

      resolve({ errCode: 0, message: " was deleted!" });
    } catch (error) {
      reject(error);
    }
  });
};
module.exports = {
  getAllPosts: getAllPosts,
  createPost: createPost,
  updatePost: updatePost,
  deletePostById: deletePostById,
};

