sourcesContent:
import db from "../models/index";

let addToCart = (productId) => {
  return new Promise(async (resolve, reject) => {
    try {
      let cart = null; // initialValue Cart
      let addedProduct = await db.Products.findOne({
        where: { id: productId },
      });

      if (addedProduct) {
        if (cart) {
          // cart not null
          // case: exist prev and add same product in cart
          const existProduct = cart.products.findIndex(
            (p) => p.productId === addedProduct.id
          );
          // if(existProduct) {

          // }
          console.log(existProduct, "exist Product");
          //   console.log(existProduct, "existproduct");
          // case: exist prev and add other product in cart
          if (existProduct > 0) {
            // exist in cart already
            addedProduct.qualityItem += 1;
            cart.products.push(addedProduct);
          } else {
            addedProduct.qualityItem = 1;
            cart.products.push(addedProduct);
            cart.totalPrice += addedProduct.priceItem;
            resolve(cart);
          }
        } else {
          // cart empty
          cart = { products: [], totalPrice: 0 };
          addedProduct.qualityItem = 1;
          cart.products.push(addedProduct);
          cart.totalPrice = addedProduct.priceItem;

          resolve(cart);
        }
      } else {
        resolve("Product was not in store");
      }
    } catch (e) {
      reject(e);
    }
  });
};
module.exports = {
  addToCart: addToCart,
};

